javascript:(function(){$.ajax({url:"/item/gacha_ticket_and_others_list_by_filter_mode",type:"GET",success:e=>{const t=parseInt($(".prt-stone").text());var a=0,r=0;e[0].forEach(e=>{switch(e.id){case 20010:a=parseInt(e.number);break;case 20011:r=parseInt(e.number)}});const s=t/300+10*a+r;alert("Total draw: "+parseInt(s)+" / 300\nComplete: "+parseInt(s/300*100)+"%")}});})();